import './style.css'



function Calculator() {
  const values = [
    "AC","DEL","%","/",
    "7","8","9","X",
    "6","5","4","-",
    "3","2","1","+",
    "0","=",
  ];

  const buttons = values.map((value) => (
    <button id={"btn_" + value}>{value}</button>
  ));
  return(
      <div id='content'>
          <div id='calculator'>{buttons}</div>;
      </div>
  )
}

export default Calculator;
